script: |
  super -f text -I q10425.spq | sort > q10425.out

inputs:
  - name: q10425.spq
    data: |
      SELECT DISTINCT - 55 AS col1 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN ( + 32 * - col0 + + col2 ) AND - col2 * - - col1 - + + col0;
  - name: tab1

outputs:
  - name: q10425.out
    data: |
